def get_device_type(mac):
    """Identify device type using OUI."""
    if not mac or len(mac) < 8:
        return "Unknown"
    oui = mac.upper()[0:8]
    oui = oui.replace("-", ":")
    if oui in OUI_VENDOR_MAP:
        return OUI_VENDOR_MAP[oui][1]
    # Try 3 bytes only
    oui3 = ":".join(oui.split(":")[:3])
    vendor = OUI_VENDOR_MAP.get(oui3, (None, None))[0]
    if vendor:
        # Try to infer type from vendor
        for kw, dtype in VENDOR_KEYWORDS:
            if kw in vendor.lower():
                return dtype
    # Try by vendor keywords from full mac string
    for kw, dtype in VENDOR_KEYWORDS:
        if kw in mac.lower():
            return dtype
    return "Unknown"
